import '../wallet.scss';
import React, { useState, useEffect, useRef } from 'react';
import { Table } from 'reactstrap';
import Axios from 'axios';
import { connect } from 'react-redux';
import { IRootState } from 'app/shared/reducers';
import { RouteComponentProps } from 'react-router-dom';
import moment from 'moment';
import { setWalletData } from 'app/shared/reducers/reports';
import ReactToPrint from 'react-to-print';
import { isEmpty } from 'lodash';
import exportFromJSON from 'export-from-json';
import MoneyFormat from 'react-number-format';
import { useLocation } from 'react-router-dom';

import './callOverReport.scss';

export interface IStatementProps extends StateProps, DispatchProps, RouteComponentProps<{}> {}
function CallOverReport(props: IStatementProps) {
  const location = useLocation();

  const [callOver, setCalloverReport] = useState([
    {
      transactionRef: '',
      currentBalance: '',
      credit: false,
      debit: false,
      memo: '',
      transactionDate: '',
      channel: '',
      narration: '',
      transRef: '',
      amount: '',
      beneficiaryName: '',
      createdDate: '',
      sourceAccountName: '',
      status: '',
      transactionDescription: '',
    },
  ]);
  const [opening, setOpening] = useState('');
  const [closing, setClosing] = useState('');
  const [data, setData] = useState({
    accountOwnerName: '',
    dateOpened: moment(Date()).format('YYYY-MM-DD'),
    accountNumber: '',
    schemeName: '',
    start: location.state.start || moment(Date()).format('YYYY-MM-DD'),
    end: location.state.end || moment(Date()).format('YYYY-MM-DD'),
  });
  const [format, setFormat] = useState('pdf');
  const toPrint = useRef();

  const { start, end } = data;

  const exportFile = () => {
    enum toexport {
      csv = 'csv',
      xls = 'csv',
      txt = 'txt',
      json = 'json',
    }
    const dataToExport = callOver;
    const fileName = 'specswallet Report';
    exportFromJSON({ data: dataToExport, fileName, exportType: toexport[format] });
  };

  const getCalloverReport = async (startDate: string, endDate: string) => {
    // setData({...data,...info})
    try {
      const url = `/api/transaction/logs/${startDate}/${endDate}?page=0&size=100000`;

      // eslint-disable-next-line no-console
      console.log(url);
      // const callOverReport = await Axios.get(`/api/transaction/logs?page=0&size=1000`);
      const callOverReport = await Axios.get(url);
      // if(getWalletAccount.data.data.length && getWalletAccount.data.data.length > 0) {
      //     setOpening(getWalletAccount.data.data[0]['currentBalance']);
      //     setClosing(getWalletAccount.data.data[getWalletAccount.data.length - 1]['currentBalance']);
      // }

      // eslint-disable-next-line no-console
      console.log('response data:', callOverReport.data.data);
      setCalloverReport(callOverReport.data.data);
      console.error(callOverReport.data);
    } catch (e) {
      console.error(e);
    }
  };
  useEffect(() => {
    // // eslint-disable-next-line no-console
    // console.log(`/api/transaction/logs/${start}/${end}?page=0&size=1000`);

    getCalloverReport(start, end);
    //  console.error(props.data,  'hello');
  }, []);

  return (
    <>
      <div style={{ float: 'right' }}>
        <select onChange={e => setFormat(e.target.value)} style={{ height: '50px', marginRight: '10px' }} className="formatprint">
          <option value="pdf">pdf</option>
          <option value="xls">xls</option>
          <option value="csv">csv</option>
          <option value="txt">text</option>
          <option value="json">json</option>
        </select>
        {format === 'pdf' && (
          <ReactToPrint
            trigger={() => {
              return (
                <button style={{ marginTop: '10px', marginRight: '40px', border: '1px solid #565682', fontSize: '12px' }}>
                  Download or print
                </button>
              );
            }}
            content={() => toPrint.current}
          />
        )}
        {format !== 'pdf' && (
          <button onClick={exportFile} style={{ marginTop: '10px', marginRight: '40px', border: '1px solid #565682', fontSize: '12px' }}>
            Print {format}
          </button>
        )}
      </div>
      <section ref={toPrint}>
        <span className="titles">Call Over Report</span>
        <div style={{ marginLeft: '54px' }}>
          <p className="titles2">Summary</p>
          <div className="dateContainer">
            <table>
              <thead></thead>
              <tbody>
                {/* <tr className = 'drow'>
                               <th>Wallet Owner Name: </th>
                               <td>{data.accountOwnerName}</td>
                           </tr> */}
                {/* <tr className = 'drow'>
                               <th>Data Created: </th>
                               <td>{data.dateOpened}</td>
                           </tr> */}
                <tr>
                  <th>Date Range: </th>
                  <td className="filtered-date-box">
                    <span>{!isEmpty(data.start) ? data.start : data.dateOpened}</span>
                    <span>→</span>
                    <span>{!isEmpty(data.end) ? data.end : moment(Date()).format('YYYY-MM-DD')}</span>
                  </td>
                </tr>
                {!isEmpty(data.schemeName) && (
                  <tr className="drow">
                    <th>Scheme Name: </th>
                    <td>{data.schemeName}</td>
                  </tr>
                )}
                {/* <tr className = 'drow'>
                               <th>Opening Balance: </th>
                               <td>₦{opening}</td>
                           </tr>
                           <tr className = 'drow'>
                               <th>Closing Balance: </th>
                               <td>₦{closing}</td>
                           </tr> */}
              </tbody>
            </table>
          </div>
        </div>
        <div style={{ marginLeft: '54px', marginTop: '50px' }}>
          <div>
            <p className="titles2">REPORT DETAILS</p>
          </div>
          <Table striped>
            <thead>
              <th>S/N</th>
              <th>Transaction Date</th>
              <th>Payment Type</th>
              <th>Description</th>
              <th>Referrence Number</th>
              <th>Source Account Name</th>
              {/* <th>Source Account Amount (₦)</th> */}
              <th>Destination Account Name</th>
              <th>Amount (₦)</th>
              <th>Status</th>
            </thead>
            <tbody>
              {callOver.map((v, i) => (
                <tr className="tdata" key={i}>
                  <td>{i + 1}</td>
                  <td>{moment(v.createdDate).format('ll')}</td>
                  <td style={{ color: v.transactionDescription === 'Invalid transaction' ? 'hsl(0, 100%, 50%)' : 'initial' }}>
                    {v.transactionDescription}
                  </td>
                  <td>{v.narration}</td>
                  <td>{v.transRef}</td>
                  <td>{!isEmpty(v.sourceAccountName) ? v.sourceAccountName : '---'}</td>
                  {/* <td>
                                <MoneyFormat
                                    value = {Number(v.amount)}
                                    displayType = 'text'
                                    thousandSeparator = {true}
                                    decimalScale = {2}
                                    fixedDecimalScale = {true}
                                   // prefix = "₦"
                                />
                                </td> */}
                  <td>{!isEmpty(v.beneficiaryName) && v.beneficiaryName !== 'null' ? v.beneficiaryName : '---'}</td>
                  <td>
                    <MoneyFormat
                      value={Number(v.amount)}
                      displayType="text"
                      thousandSeparator={true}
                      decimalScale={2}
                      fixedDecimalScale={true}
                      // prefix = "₦"
                    />
                  </td>
                  <td>
                    <span
                      className="call-status-box"
                      style={{
                        backgroundColor:
                          v.status === 'COMPLETED'
                            ? 'hsl(147, 100%, 33%)'
                            : v.status === 'REVERSED'
                            ? 'hsla(219, 92%, 46%, 0.987)'
                            : 'hsl(0, 100%, 33%)',
                      }}
                    >
                      {v.status}
                    </span>
                  </td>
                </tr>
              ))}
            </tbody>
          </Table>
        </div>
      </section>
    </>
  );
}

const mapStateToProps = ({ reports }: IRootState) => ({
  data: reports.data,
});

const mapDispatchToProps = { setWalletData };

type StateProps = ReturnType<typeof mapStateToProps>;
type DispatchProps = typeof mapDispatchToProps;

export default connect(mapStateToProps, mapDispatchToProps)(CallOverReport);
